-- GUI Toggle Function
local function handleGuiToggle(data)
	if not data.loaded then
		local ok, result = pcall(function()
			loadstring(game:HttpGet(data.url))()
		end)
		if ok then
			local g = CoreGui:FindFirstChild(data.name) or PlayerGui:FindFirstChild(data.name)
			if g then
				data.gui = g
				data.loaded = true
				data.btn.Text = ihygnYaPhHnAisNHgkWonnNNpqfGyR({'************************************************************************','*********************************************************************************************************','****************************************************************************************************','*****************************************************************************************************'})
			end
		end
	else
		if data.gui then
			data.gui.Enabled = not data.gui.Enabled
			data.btn.Text = data.gui.Enabled and ihygnYaPhHnAisNHgkWonnNNpqfGyR({'************************************************************************','*********************************************************************************************************','****************************************************************************************************','*****************************************************************************************************'}) or ihygnYaPhHnAisNHgkWonnNNpqfGyR({'***********************************************************************************','********************************************************************************************************','***************************************************************************************************************','***********************************************************************************************************************'})
		end
	end
end

